import React from 'react';
import { Link } from 'react-router-dom';
import logo from '../Images/logo.png';

const Navbar = () => {
  return (
    <header className="absolute top-0 left-0 right-0 z-20" style={{backgroundColor: 'transparent'}}>
      <div className="container mx-auto flex items-center justify-between py-6 px-4" style={{maxWidth: '1200px', margin: '0 auto', display: 'flex', alignItems: 'center', justifyContent: 'space-between'}}>
        <Link to="/" style={{textDecoration: 'none'}}>
          <img src={logo} alt="MOE" className="h-16 w-auto" />
        </Link>
        <nav className="flex items-center gap-8">
          <a href="#top" className="text-white hover:text-gray-200 font-medium uppercase tracking-wide">HOME</a>
          <div className="relative group">
            <a href="#projects" className="text-white hover:text-gray-200 font-medium uppercase tracking-wide">PROJECTS</a>
            <div className="absolute hidden group-hover:block pt-3 left-0">
              <div className="bg-white border rounded shadow-md py-2 w-48">
                <a href="#residential" className="block px-4 py-2 text-sm text-gray-700 hover:bg-gray-50">RESIDENTIAL</a>
                <a href="#commercial" className="block px-4 py-2 text-sm text-gray-700 hover:bg-gray-50">COMMERCIAL</a>
                <a href="#school" className="block px-4 py-2 text-sm text-gray-700 hover:bg-gray-50">SCHOOL</a>
                <a href="#interior" className="block px-4 py-2 text-sm text-gray-700 hover:bg-gray-50">INTERIOR DESIGN</a>
              </div>
            </div>
          </div>
          <a href="#about" className="text-white hover:text-gray-200 font-medium uppercase tracking-wide">ABOUT</a>
          <a href="#contact" className="text-white hover:text-gray-200 font-medium uppercase tracking-wide">CONTACT</a>
        </nav>
        <div className="w-16"></div>
      </div>
    </header>
  );
};

export default Navbar;
